query ($private: Int){
  projects: allProject (filter: { private: { ne: $private }, tags: { id: {in: ["farming"]}}}){   
    edges {
        node {
                id
          title
          path
          members {
            id
          name
          image(width:64, height:64, fit:inside)
          path
      }
        rank
        linkedin
        
        humanTime : created(format:"DD MMMM YYYY")
        datetime : created(format:"ddd MMM DD YYYY hh:mm:ss zZ")
        status
        excerpt
        image(width:800)
        path
        timeToRead
        authors {
          id
          
          image(width:64, height:64, fit:inside)
          path
        }
      }
    }
  }

  people: allPerson(filter: { private: { ne: $private }, memberships: { id: {in: ["foundation", "tech"]}}}) {   
     edges {
      node {
        id
        path
        excerpt
        content
        name
        rank
         memberships{
          id
          title
          path
        }
        bio
        linkedin
        websites
        countries
        cities
        image(width:800)
        private
      }
    }
  }

  blogs: allBlog {
    edges {
      node {
        id
        title
        image(width:800)
        path
        humanTime : created(format:"DD MMM YYYY")
        datetime : created
        authors {
          id
          name
          image(width:64, height:64, fit:inside)
          path
        }
      }
    }
  }

  markdowns: allMarkdownPage{
    edges{
      node{
        __typename
        header_title
        header_excerpt
        path
      #  title
        excerpt
      }      
    }
  }
}
